_body: !!python/object:github.GithubObject._ValuedAttribute
  value: "Fixes: #30606\r\n\r\nWhile setting up my new Windows 10 Pro laptop I took\
    \ the default path for installing the Java 10 JRE;\r\n\"C:\\Program Files (x86)\\\
    Common Files\\Oracle\\Java\" \r\n\r\nI'm running a Kibana script that downloads\
    \ and starts the latest elasticsearch snapshot but it kept failing with this error;\r\
    \n`ERROR \\Common was unexpected at this time.`\r\n\r\n@Dobatymo and @Lashchev\
    \ suggested variations on a fix in #30606.  I applied the changes exactly as Lashchev\
    \ suggested here https://github.com/elastic/elasticsearch/issues/30606#issuecomment-399904716\r\
    \n\r\nIt resolved this problem for me.\r\n\r\nNOTE: In my case, I had the JRE\
    \ installed to that default path, and although I had the jdk 10 installed, I did\
    \ not have JAVA_HOME set, so it was using the java executable from the JRE that\
    \ was in my path var.\r\n\r\nIf I set my JAVA_HOME variable (my jdk path has no\
    \ spaces or parenthesis) I can start elasticsearch without this fix.  But we should\
    \ fix this problem since it would a common case for Windows users to download\
    \ the JRE, take the default installation path, and then try to start Elasticsearch.\r\
    \n\r\n"
